import React, { useState } from 'react';
import './App.css';

function App() {
    const [isOpen, setIsOpen] = useState(false);

    // Base64 encoded PDF (replace with your actual base64 data)
    const base64Pdf = "data:application/pdf;base64,";  // Replace with your base64 PDF string

    // Function to toggle modal open/close
    const toggleModal = () => setIsOpen(!isOpen);

    return (
        <div className="App">
            <button onClick={toggleModal} className="App-button">
                Preview PDF
            </button>

            {isOpen && (
                <div className="modal">
                    <div className="modal-content">
                        <span className="close" onClick={toggleModal}>&times;</span>
                        <iframe
                            src={base64Pdf}
                            width="100%"
                            height="500px"
                            title="PDF Preview"
                        ></iframe>
                    </div>
                </div>
            )}
        </div>
    );
}

export default App;